import React, { useContext } from 'react'
import { store } from '../App';
import { redirect } from 'react-router-dom';
const MyProfile = () => {
const [token,setToken]    = useContext(store)
if(!token){
    return <redirect to='/login'/>
}
  return (
    <div>MyProfile</div>
  )
}

export default MyProfile
